This was truly nice and relaxing! (At least until it got to the point that I got really frustrated that I just can't get my upper body down in that seated forward fold. I feel ridiculous even trying that ;__;
And the crow, well... that is somewhere, sommmmewhere on the horizon I guess. But at least I could grab my ankle in the pigeon and that felt really good. Not just that I was able to reach it, but the stretch was really nice!
Thank you so much Adriene for making sure that I have a great day by creating great videos like this!
